export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input field to be visible
    await page.waitForSelector('#eventSearchInput');

    // Type 'team' into the search input
    await page.fill('#eventSearchInput', 'team');

    // Take a screenshot after entering the search term
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_typing.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_typing.png'));

    // Click the search button
    await page.click('.search-btn');

    // Wait for the results to load (assuming some results appear)
    await page.waitForSelector('.event-result'); // Adjust selector based on actual results

    // Take a screenshot of the results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_results.png'));

    // Extract meaningful data to verify task completion
    const results = await page.$$eval('.event-result', elements => 
      elements.map(el => el.textContent)
    );

    return {
      success: true,
      action: "Searched for team-related events successfully",
      extractedData: { results },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

